get.description:
Retrieve Ticket Buyer Settings by Event ID.

Example:

```json
{
    "confirmation_message": {
        "text": "<H1>Confirmation Message</H1>",
        "html": "Confirmation Message"
    },
    "instructions": {
        "text": "<H1>Instructions</H1>",
        "html": "Instructions"
    },
    "event_id": "43253626762",
    "refund_request_enabled": true,
    "redirect_url": null
}
```
